import React from "react";

const LocationSec = (props) => {
    return (
        <div>
            <h1>{props.name}</h1>
            <p>{props.location===undefined ? 'Use Phone/Laptop for Video Call' : `Location: ${props.location}`} </p>
            <p>Fees: {props.fees}</p>
            
        </div>
    );
}

export default LocationSec;
